<html>
  <head>
    <script type="text/javascript" src="https://www.google.com/jsapi"></script>
    <script type="text/javascript">
    google.load("visualization", "1", {packages:["corechart"]});
    google.setOnLoadCallback(drawChart);
    function drawChart(){
    var msPrecision = [["Time in us", "msPrecision"]];
msPrecision.push([0.000000, 0.000000]);
msPrecision.push([1.000000, 1.000000]);
msPrecision.push([2.000000, 1.000000]);
msPrecision.push([3.000000, 1.000000]);
msPrecision.push([4.000000, 0.000000]);
msPrecision.push([5.000000, 1.000000]);
msPrecision.push([6.000000, 1.000000]);
msPrecision.push([7.000000, 1.000000]);
msPrecision.push([8.000000, 1.000000]);
var msPrecision_graph = google.visualization.arrayToDataTable(msPrecision);
var msPrecision_chart = new google.visualization.LineChart(document.getElementById("msPrecision"));
msPrecision_chart.draw(msPrecision_graph, {title: "Time taken (us)"});
    }
    </script>
  </head>
  <body>
    <div id="msPrecision" style="width: 900px; height: 400px; float:left;"></div>  </body>
</html>
